import Axios from "axios";
import {useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState(null);

  useEffect(()=>{
    Axios.get('/api')
      .then((res) => {
        console.log(res.data)
        setData(res.data)
      })
  }, [])

  return (
    data == null ? (
      <div className="App">
        no data 
      </div>
    ) : (
      <div className="App">
        {
          data.map((item) =>{
            return (
              <>
                <p>{item.STT}</p>
                <p>{item.Phong}</p>
                <p>{item.Loai_Phong}</p>
              </>
            )
          })
        }
      </div>
    )
  );
}

export default App;
